style.css:
@-moz-document domain("roblox.com") {

#fb-root {
    background-image: url(https://www.nawpic.com/media/2020/aesthetic-backgrounds-nawpic-9.jpg) !important;
    position: fixed;
    background-attachment: fixed;
    width: 102%;
    height: 102%;
}



.container-fluid {
    margin-right: auto;
    margin-left: auto;
    padding-left: 0;
    padding-right: 0;
    background-color: rgb(248,215,232, 0.7)
}

.light-theme .rbx-header .text-header, .light-theme .rbx-header .text-header:active, .light-theme .rbx-header .text-header:focus, .light-theme .rbx-header .text-header:hover, .light-theme .rbx-header .text-header:link, .light-theme .rbx-header .text-header:visited {
    color: black;
    font-weight: bold
}



.light-theme .icon-default-navigation, .light-theme .icon-nav-blog, .light-theme .icon-nav-charactercustomizer, .light-theme .icon-nav-friends, .light-theme .icon-nav-giftcards, .light-theme .icon-nav-group, .light-theme .icon-nav-home, .light-theme .icon-nav-inventory, .light-theme .icon-nav-menu, .light-theme .icon-nav-message, .light-theme .icon-nav-my-feed, .light-theme .icon-nav-notification-stream, .light-theme .icon-nav-profile, .light-theme .icon-nav-robux, .light-theme .icon-nav-search-white, .light-theme .icon-nav-settings, .light-theme .icon-nav-shop, .light-theme .icon-nav-trade {
    background-image: url(https://images.rbxcdn.com/5be09c7c686dbba1984fc1a2bacb772c-navigation_light.svg);
}



.light-theme .content {
    background-color: rgb(248,215,232, 0.7);
    color: black;
    font-weight: bold
}




.rbx-left-col li .text-nav .font-header-2 {
    display: inline-block;
    margin: 3px;
    color: black;
    font-weight: bold
}

.game-card-link .game-card-name {
    margin-bottom: 6px;
    color: black;
    font-weight: bold
}




.light-theme .container-footer {
    background-color: rgb(248,215,232, 0.7);
}


.catalog-content .search-options .category-section {
    padding-bottom: 12px;
    border-width: 5px;
}


.light-theme .rbx-left-col {
    box-shadow: 0 0 8px 0 rgb(0 0 0 / 10%);
    background-color: rgb(248,215,232, 0.7);
}

#game-details-play-button-container .btn-common-play-game-lg {
    margin: 0 auto;
    background-color: rgb(248,215,232, 0.7);
    border-color: rgb(248,215,232, 0.7);
}

.light-theme .btn-common-play-game-lg::before {
    font-weight: bold;
    color: white;
    content: "PLAY ";
    font-size: 30px;
    text-align: center;
}

.btn-common-play-game-lg span[class^=icon-], .btn-common-play-game-lg span[class^=icon-]:hover, a.btn-common-play-game-lg span[class^=icon-], a.btn-common-play-game-lg span[class^=icon-]:hover {
    background-size: 0px auto;
    width: 0px;
    height: 0px;
}


.light-theme .item-card .item-card-thumb-container:before {
    border-radius: 8px;
    position: absolute;
    content: "";
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    transition: opacity .3s linear;
      background: linear-gradient(45deg, rgb(248,215,232, 0.3), rgb(248,215,232, 0.6));
    opacity: 0;
}
}
